import React from "react";

const FullNote = ({ currentNote: { id, title, location, content} }) => {


  const style = {
    border: "1px solid purple",
    padding: "1rem",
    margin: "1rem"
  };

  return (
    <div key={id} style={style}>
      <h1>{title}</h1>
      <h2>{location}</h2>
      <p>{content}</p>
    </div>
  );
};

export default FullNote;
